    [],nt"revision_timestamp": "2015-09-26T22:08:05.866885",nt"name": "nodc-standard-product-oceanographic-station-profile-time-series-nodc-accession-0095191",nt"isopen":
    false,nt"url": null,nt"notes": "The National Oceanographic Data Center
    and the World Data Center-A for Oceanography compiled from the NODC Oceanographic
    Station Data File a set of oceanographic data having repetitive samples along ocean
    sections or at fixed stations for long time periods. These oceanographic station
    time-series include temperature, salinity, density, and nutrient data. The total
    time-series data set contains: 27 North Pacific sections; 56 North Atlantic sections;
    sections along coastal California from the California Cooperative Fisheries Investigations
    (CALCOFI); 19 sections from other ocean regions; and data from the 10 Ocean Weather
    Stations.nnThe CD-ROM contains both data and inventory files. Each inventory file
    is sorted by NODC Reference Number. The data on this disc are stored as ASCII records
    in the NODC Oceanographic Station Data (SD2) format.nnCopies of this disc are currently
    available via the NODC Online Store atnhttp://ols.nndc.noaa.gov/plolstore/plsql/olstore.prodspecific?prodnum=W00006-CDR-S0001.nnAdditional
